import React from 'react';

/*change this css file name according your css*/
import './Cubetemplate.css';


const Cubetemplate = ({ source }) =>(


    <div>
            <div>
                <div className="bigdiv">
                    <div className="cubebox">
                        <div className="boxcontent">
                            <div className="textbox">

                                {/* this is the topic */}
                                <h2>The Most Epic Text Ever Written</h2>

                                {/* the small description */}
                                <p>The medium length sentence that will give you goosebumps</p>
                            </div>
                            <div className="innerimg"><img src={`../images/${thissource}`} alt="Example" className="w-25 m-2" /></div>

                        </div>
                    </div>
                </div>
                
            </div>

        <div className="spacer2"></div>
    </div>

);

export default Cubetemplate;
